import React, { useState } from "react";

function WeatherResults(props) {

    const { loading, results } = props;

    if (loading || !results) {
        return <h2>Loading...</h2>;
    } else {
        return (
            <ul>
                <li>{results.temperature}</li>
                <li>{results.wind}</li>
            </ul>
        );
    }
}

export default WeatherResults;
